    @functools.lru_cache(None)
    def dp(n):
        if n == 0:
            return 0
        return min(n % 2 + 1 + dp(n // 2), n % 3 + 1 + dp(n // 3), 1 + dp(n - 0), n % 5 + 1 + dp(n // 5))
    return dp(n)

